package com.my.shortest_palindrome;

/**
 * Created by alex.bykovsky on 7/13/17.
 */
public class SolutionMy {

	public static void main(String[] args) {
		System.out.println(new SolutionMy().shortestPalindrome("a"));
		//a
		System.out.println(new SolutionMy().shortestPalindrome("bb"));
		//bb
		System.out.println(new SolutionMy().shortestPalindrome("ca"));
		//aca
		System.out.println(new SolutionMy().shortestPalindrome("ba"));
		//aba
		System.out.println(new SolutionMy().shortestPalindrome("dbbb"));
		//bbbdbbb
		System.out.println(new SolutionMy().shortestPalindrome("bbbd"));
		//dbbbd
		System.out.println(new SolutionMy().shortestPalindrome("abcbacba"));
		//abcabcbacba
		System.out.println(new SolutionMy().shortestPalindrome("dbbbd"));
		//dbbbd
		System.out.println(new SolutionMy().shortestPalindrome("dbbc"));
		//cbbdbbc
		System.out.println(new SolutionMy().shortestPalindrome("aacecaaa"));
		//aaacecaaa
		System.out.println(new SolutionMy().shortestPalindrome("abcd"));
		//dcbabcd
		System.out.println(new SolutionMy().shortestPalindrome("abb"));
		//bbabb
		System.out.println(new SolutionMy().shortestPalindrome("abbacd"));
		//dcabbacd
		System.out.println(new SolutionMy().shortestPalindrome("babbbabbaba"));
		//ababbabbbabbaba
		System.out.println(new SolutionMy().shortestPalindrome("aabababababaababaa"));
		//aababaabababababaababaa

		long start = System.currentTimeMillis();
		System.out.println(new SolutionMy().shortestPalindrome(""));
		System.out.println(System.currentTimeMillis() - start);
	}

	public String shortestPalindrome(String s) {

		int j = 0;
		for(int i = s.length() - 1; i >= 0; i--) {
			if(s.charAt(j) == s.charAt(i)) {
				j++;
			}
		}

		if(j >= s.length()) return s;

		return new StringBuilder(s.substring(j)).reverse() + shortestPalindrome(s.substring(0, j)) + s.substring(j);
	}
	
}
